import uniqid from 'uniqid'
import './Projects.css'

const education = [
  '광주송원고등학교 졸업 (1986)',
  '서울대학교 사회복지학과 졸업 (1991)',
  '서울대학교 대학원 사회복지학과 수료 (1993)',
  '총신대학교 신학대학원 졸업 (1996)',
]

const Projects = () => {
  if (!education.length) return null

  return (
    <section id='projects' className='section projects'>
      <h2 className='section__title'>학력</h2>

      <ul className='projects__grid'>
        {education.map((item) => (
          <li key={uniqid()} className='education__item'>
            {item}
          </li>
        ))}
      </ul>
    </section>
  )
}

export default Projects
